import React from "react";
import { Link } from "react-router-dom";

const Products = () => {
  return (
    <section>
      <h1>The Products Page</h1>
      <ul>
        <li>A Book</li>
        <li>A Carpet</li>
        <li>An online course</li>
      </ul>
    </section>
  );
};

export default Products;
